import axios from 'axios';

const BASE_URL = '/api/v1/session';

export const searchSession = async (params) => {
  const queryParams = new URLSearchParams(params).toString();
  const response = await axios.get(`${BASE_URL}?${queryParams}`);
  return response.data;
};

export const startSession = async (data) => {
  const response = await axios.post(`${BASE_URL}?expireAt=ONE_HOUR`, data);
  return response.data;
};
